        "years": 2021,
        "color": "Green",
        "price": 27000,
        "car_body": "Sedan"
    },
    {
        "brand": "BMW",
        "model": "X5",
        "years": 2023,
        "color": "Gray",
        "price": 55000,
        "car_body": "SUV"
    },
    {
        "brand": "Toyota",
        "model": "Camry",
        "years": 2020,
        "color": "Blue",
        "price": 35000,
        "car_body": "Sedan"
    },
    {
        "brand": "Ford",
        "model": "Mustang",
        "years": 2022,
        "color": "Yellow",
        "price": 45000,
        "car_body": "Coupe"
    },
    {
        "brand": "Chevrolet",
        "model": "Suburban",
        "years": 2019,
        "color": "Black",
        "price": 50000,
        "car_body": "SUV"
    }
]

  function Car({brand,model,years,color,price,car_body}){
 
    return   <td class="nav-item">
    <a className="nav-link" href="#">{color}</a>
</td>
};



export default function Carlist(){

const displayCars=()=>{
    return cars.map(
        car=>{
      
       const {brand,model,years,color,price,car_body}=car;
           
       return( <Car   brand={brand} model={model} years={years} color={color} price={price} car_body={car_body}/>)
        }
    )
}
    return(
    <>
   
    
<table class="table">
    <thead>
        <tr>
            <th>brand</th>
            <th>model</th>
            <th>years</th>
            <th>color</th>
            <th>price</th>
            <th>price</th>
            <th>car_body</th>
        </tr>
    </thead>
    <tbody>
        <tr>
     
                {displayCars()}
            
        </tr>
    </tbody>
</table>
    </>
    )
}
